import React from 'react';

const FlagYe = props => (
  <svg viewBox="0 0 450 300" {...props}>
    <path d="M0 0h450v300H0z" />
    <path fill="#FFF" d="M0 0h450v200H0z" />
    <path fill="#CE1126" d="M0 0h450v100H0z" />
  </svg>
);

export default FlagYe;
